public void testGetPrefix(){
  JakartaRegexpCapabilities cap = new JakartaRegexpCapabilities();
  cap.compile("luc[e]?");
  assertTrue(cap.match("luce"));
  assertEquals("luc", cap.prefix());

  cap.compile("lucene");
  assertTrue(cap.match("lucene"));
  assertEquals("lucene", cap.prefix());
}

